import React from 'react';
import Login from './Login';
import axios from 'axios';

const baseURL = "http://localhost:3030";

function App() {
    const [post, setPost] = React.useState(null);

    React.useEffect(() => {
      axios.get(baseURL).then((response) => {
        setPost(response.data);
      });
    }, []);

    if (!post) return null;
  return (
    <div>
      <h1>My App</h1>
      <>{post.Login}</>
    </div>
  );
}

export default App;
